  return (
    <div>
      {/* <Nav /> */}
      <div id="wrapper">
        <MenuLeft />
      </div>

      <main role="main" class="col-md-9 ml-sm-auto col-lg-10 px-4">
        <h1>Main</h1>
        <Charts />
      </main>
    </div>
  );
}

export default layout;
